      <h1 className="prtitle">Proyectos</h1>
<div className="proyectos" id="project">

<div className="proyect" >
<div className="view"><a href="https://cdrconsulting.pe/" target='_blank'>Ver Trabajo</a></div>
</div>




</div>
  </div>
     )
   }
 }
